```sql
/* Select the encounter descriptions */
SELECT
  e.description
/* From the encounters table (e) */
FROM encounters AS e
/* Left join with the procedures table (p) on encounter id */
LEFT JOIN procedures AS p
  ON e.id = p.encounter
/* Where procedure description contains 'Depression screening' */
WHERE
  p.description LIKE '%Depression screening%';
```

